import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';

function VideoCard() {
  return (
    <>
     
    
     <Card style={{ width: '18rem' }}>
      <Card.Img variant="top" height="400px"  src="https://pbs.twimg.com/media/F8iee9YaEAAHBAr?format=jpg&name=4096x4096" />
      <Card.Body>
        <Card.Title></Card.Title>
        <Card.Text>
            <div className='d-flex'>  <h5 style={{fontFamily:"-moz-initial"}}>Video caption</h5>
            
            </div>
          
         
        </Card.Text>
       
      </Card.Body>
    </Card>
    </>
   
  )
}

export default VideoCard
